import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "../Component/Home";

const Routes1 = () => {
  return (
    <BrowserRouter>
      <Routes>
        {/* <Route exact path="/register" element={<Register />} /> */}
        <Route path="/home" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
};

export default Routes1;
